trailingComments.value:
*
 * 获取书籍下载信息
 *
 * 支持平台：书旗Android
 *
 * @returns {Promise<{height: number, width: number}>}
 *
 * @example
 * libSQ.exec('get-download-book-info', {
 *  params: {
 *     bookId: '169419',
 *     downLoadType: '1',
 *   },
 * }).then((info) => {
 *   alert(`[refresh][get-download-book-info][then] ${JSON.stringify(info, null, 2)}`);
 * }).catch((err) => {
 *   alert(`[refresh][get-download-book-info][error] ${JSON.stringify(err, null, 2)}`);
 * });

